import React from 'react';
import { Container, Wrapper, Row, Column, Link, Btn, Text, Button, Title, Search, Input } from './styles/footer';

export default function Footer({ children, ...restProps }) {
  return <Container {...restProps}>{children}</Container>;
}

Footer.Wrapper = function FooterWrapper({children, ...restProps}) {
  return <Wrapper {...restProps}>{children}</Wrapper>
}

Footer.Row = function FooterRow({ children, ...restProps }) {
  return <Row {...restProps}>{children}</Row>;
};

Footer.Column = function FooterColumn({ children, ...restProps }) {
  return <Column {...restProps}>{children}</Column>;
};

Footer.Link = function FooterLink({ children, ...restProps }) {
  return <Link {...restProps}>{children}</Link>;
};

Footer.Title = function FooterTitle({ children, ...restProps }) {
  return <Title {...restProps}>{children}</Title>;
};

Footer.Text = function FooterTitle({ children, ...restProps }) {
    return <Text {...restProps}>{children}</Text>;
};

Footer.Btn = function FooterTitle({ children, ...restProps }) {
  return <Btn {...restProps}>{children}</Btn>;
};

Footer.Search = function FooterTitle({ children, ...restProps }) {
  return <Search {...restProps}>{children}</Search>;
};

Footer.Button = function FooterTitle({ children, ...restProps }) {
  return <Button {...restProps}>{children}</Button>;
};

Footer.Input = function FooterTitle({ children, ...restProps }) {
  return <Input {...restProps}>{children}</Input>;
};
